
export enum Sound {
  MOVE, // https://freesound.org/people/deleted_user_6479820/sounds/393814/
  STOP, // https://freesound.org/people/Breviceps/sounds/447910/
  EXPLODE, // https://freesound.org/people/Nbs%20Dark/sounds/94185/
  TRAP, // https://freesound.org/people/plasterbrain/sounds/423166/
  SENSOR, // https://freesound.org/people/penetrermind/sounds/405669/
  EXIT, // https://freesound.org/people/kianda/sounds/328120/
}

/**
 * Sound effects.
 * These are played using the HTML Audio element.
 */
export class Sfx {

  /**
   * Initializes the sound.
   */
  public static init() {
    Sfx.sounds.set(Sound.MOVE, "data:audio/mpeg;base64,");
    Sfx.sounds.set(Sound.STOP, "data:audio/mpeg;base64,");
    Sfx.sounds.set(Sound.EXPLODE, "data:audio/mpeg;base64,");
    Sfx.sounds.set(Sound.TRAP, "data:audio/mpeg;base64,");
    Sfx.sounds.set(Sound.SENSOR, "data:audio/mpeg;base64,");
    Sfx.sounds.set(Sound.EXIT, "data:audio/mpeg;base64,");
  }

  /**
   * Asynchronously plays the given sound.
   * @param sound the sound to play.
   */
  public static play(sound: Sound): void {
    const audio = new Audio(Sfx.sounds.get(sound));
    audio.loop = false;
    audio.play();
  }

  private static readonly sounds: Map<Sound, string> = new Map();

}

Sfx.init();
